Let's say you failed a test or some other kind of task... Then because you're triggered inwardly you start to criticize yourself. If you turn to that critical part of you and say: "Hey listen you! You're not okay! I don't appreciate you, I don't accept you." It might feel good at first, but it doesn't make the inner critic go away.

This is done with the best intentions but what you've actually done in this instance is pushed a part of yourself farther away.

The inner critic is actually a protector trying to help us in the best way it knows how. So here's how I respond to my inner critic.

"Hey, why are you talking to me like that?"

"Well, you see, if we fail there will be consequences."

"Well thank you for trying to protect me, but I'm really working on allowing myself to be imperfect while surrounding myself with people and situations that are able to accept me even when I fail."

"But what if we don't find those people?"

"Even if we don't find people like that I promise I will always be there for you no matter what. Still, with over 6 billion people on Earth I'm sure that we will find them."

And that's just one example of how I deal with negative thinking. What kinds of positive things can you say to your own inner critic or other negatively driven part of yourself? Leave a comment down below.

